import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Main1 from '../asset/main1.jpeg';

const LandingPage = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    industry: '',
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your form submission logic here
    console.log('Form submitted:', formData);
  };

  const { firstName, lastName, email, industry } = formData;

  return (
    <div className="items-center bg-indigo-400 ">
      <div className='text-center justify-center'>
        <nav className='flex pt-5 items-center justify-between'>
          <Link to='/' className='text-xl ml-8 text-black'>Richard</Link>
          <div className="flex space-x-4">
            {/*
              Add your social media links here
              Example: <a href="#" className="text-black"><i className="fab fa-facebook"></i></a>
            */}
          </div>
        </nav>
        <hr className="border-t-1 border-gray-800 w-11/12 mx-auto" />

        <div className='flex mt-2 justify-around pl-6 pr-6'>
          <div className='text-left mt-2 md:w-1/2 p-4'>
            <h1 className="text-3xl text-[#2E3D2F]  mb-2">Not rewarded enough for your creativity?</h1>
            <p className='text-white mb-2 text-2xl'>Join the Waitlist</p>
            <p className='text-[#2E3D2F]'>Sign up now and be amongst the first to take advantage of the biggest creator marketplace in Africa.</p>
            <form onSubmit={handleSubmit} className="space-y-4">
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-2">
                <div>
                  <label className="block text-sm font-medium text-gray-700">First Name:</label>
                  <input
                    type="text"
                    name="firstName"
                    value={firstName}
                    onChange={handleChange}
                    required
                    className="input-field rounded-md p-2"
                    placeholder="John"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700">Last Name:</label>
                  <input
                    type="text"
                    name="lastName"
                    value={lastName}
                    onChange={handleChange}
                    required
                    className="input-field rounded-md p-2"
                    placeholder="Doe"
                  />
                </div>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700">Industry:</label>
                <input
                  type="text"
                  name="industry"
                  value={industry}
                  onChange={handleChange}
                  required
                  className="input-field rounded-md p-2"
                  placeholder="Niche"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700">Email:</label>
                <input
                  type="email"
                  name="email"
                  value={email}
                  onChange={handleChange}
                  required
                  className="input-field rounded-md p-2"
                  placeholder="john.doe@example.com"
                />
              </div>
              <button
                type="submit"
                className="bg-indigo-500 text-white p-2 rounded-md hover:bg-indigo-600 focus:ring focus:ring-indigo-200 focus:ring-opacity-50 focus:outline-none"
              >
                Join Waitlist
              </button>
            </form>
          </div>
          <div className='md:w-1/2 mt-9 p-4 h-90'>
            <img src={Main1} alt="creative person" className='w-full h-auto object-cover' />
          </div>
        </div>

      </div>
      {/* ===========Footer========= */}
      <footer className='bg-black text-white p-4'>
        <small>Terms & Support</small>
      </footer>
    </div>
  );
};

export default LandingPage;
